    flexDirection: 'column',
    justifyContent: 'center',
    height: '100%',
    width: '100%'
  }
}

class Terms extends Component {
  state = {

  }

  render() {
    const { classes } = this.props

    return (
      <div className={classes.container}>
        Terms
